import React from 'react';
import '../App.css';

export default class Results extends React.Component {
    render() {
        return (
            <div className="App">
                <p>Humidité : {this.props.data.humidity}</p>
                <p>Pression : {this.props.data.pressure}</p>
                <p>Température : {this.props.data.temp}</p>
                <p>Température max : {this.props.data.temp_max}</p>
                <p>Température mini : {this.props.data.temp_min}</p>
                <p>Description : {this.props.data.description}</p>
            </div>
        );
    }
}
